<html>
	<head>
	
		<!--                                           -->
		<!-- Any title is fine                         -->
		<!--                                           -->
		<title>Wrapper HTML for ImageViewer</title>

		<!--                                           -->
		<!-- The module reference below is the link    -->
		<!-- between html and your Web Toolkit module  -->		
		<!--                                           -->
		<meta name='gwt:module' content='org.kuali.continuity.admin.project.ImageViewer'/>
        
                
            <link href="/continuity/css/ucreadystyles.css" rel="stylesheet" type="text/css">
			<link href="/continuity/css/ucreadyAdminElements.css" rel="stylesheet" type="text/css">
			<link href="/continuity/css/ucreadyMainElements.css" rel="stylesheet" type="text/css">  
		
	</head>

	<!--                                           -->
	<!-- The body can have arbitrary html, or      -->
	<!-- we leave the body empty because we want   -->
	<!-- to create a completely dynamic ui         -->
	<!--                                           -->
	<body>

		<!--                                            -->
		<!-- This script is required bootstrap stuff.   -->
		<!-- You can put it in the HEAD, but startup    -->
		<!-- is slightly faster if you include it here. -->
		<!--                                            -->
		
	 
		<div id="gwtRoot" class="user-accounts-page">
			<script language="javascript" src="org.kuali.continuity.admin.project.ImageViewer.nocache.js"></script>
    	</div>
	 
		
      
		<!-- OPTIONAL: include this if you want history support -->
		<iframe id="__gwt_historyFrame" style="width:0;height:0;border:0"></iframe>

	</body>
</html>
